// components/Navbar.js

import React, { useState } from 'react';
import { Link } from 'react-scroll';
import styles from './styles/Navbar.module.css';
import { motion } from 'framer-motion';

function Navbar() {
  const [activeLink, setActiveLink] = useState("home");

    return (
      <motion.div
        className={styles.navbarContainer}
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
        transition={{ duration: 1 }}
      >
        <nav className={styles.navbar}>
          <Link 
            activeClass={styles.active}
            to="home"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
            onClick={() => setActiveLink("home")}
            className={activeLink === "home" ? `${styles.active}` : ""}
          >
            Home
          </Link>
          <Link 
            activeClass={styles.active}
            to="about"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
            onClick={() => setActiveLink("about")}
            className={activeLink === "about" ? `${styles.active}` : ""}
          >
            About
          </Link>
          <Link 
            activeClass={styles.active}
            to="skills"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
            onClick={() => setActiveLink("skills")}
            className={activeLink === "skills" ? `${styles.active}` : ""}
          >
            Skills
          </Link>
          <Link 
            activeClass={styles.active}
            to="experience"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
            onClick={() => setActiveLink("experience")}
            className={activeLink === "experience" ? `${styles.active}` : ""}
          >
            Experience
          </Link>
          <Link 
            activeClass={styles.active}
            to="education"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
            onClick={() => setActiveLink("education")}
            className={activeLink === "education" ? `${styles.active}` : ""}
          >
            Education
          </Link>
          <Link 
            activeClass={styles.active}
            to="projects"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
            onClick={() => setActiveLink("projects")}
            className={activeLink === "projects" ? `${styles.active}` : ""}
          >
            Projects
          </Link>
          <Link 
            activeClass={styles.active}
            to="contact"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
            onClick={() => setActiveLink("contact")}
            className={activeLink === "contact" ? `${styles.active}` : ""}
          >
            Contact
          </Link>
        </nav>
      </motion.div>
    );
}

export default Navbar;
